import React from "react";
import logo from "./assets/ardy.png";
import "./App.css";
import { Button } from "react-bootstrap";

function App(): JSX.Element {
    return (
        <div className="App">
            <h1 className="App-header">James Paul Healy UD CISC275</h1>
            <p className="App-logo">Hello World</p>
            <Button onClick={() => console.log("I am logged")}>Click Me</Button>
            <ul>
                Do not put the following items in the deep frier:
                <li>Ice</li>
                <li>Airpods</li>
                <li>Rats</li>
            </ul>
            <img src={logo} alt="You ardy know" />
        </div>
    );
}

export default App;
